import React from 'react';
import { Link } from 'react-router-dom';
import { Card, Tooltip, OverlayTrigger, Button, ButtonToolbar } from 'react-bootstrap';
import Pokeball from '../img/Pokeball.png'
import '../css/style.css';

const PokeList = ({ name, image, url }) => {
    return (
        <div className="my-3">
            <Card style={{ width: '16rem' }} className="card-zoom">
                <Card.Body>
                    <Card.Text>
                        <Card.Img variant="top" src={Pokeball} alt="Poke" />
                    </Card.Text>
                    <div className="text-center">
                        <Link to={`/pokeinfo/${name}/${url}`} className="pokelink">
                        <ButtonToolbar>
  {['top', 'right', 'bottom', 'left'].map(placement => (
    <OverlayTrigger
      key={placement}
      placement={placement}
      overlay={
        <Tooltip id={`tooltip-${placement}`}>
          Tooltip on <strong>{placement}</strong>.
        </Tooltip>
      }
    >
      <div></div>{name}
    </OverlayTrigger>
  ))}
</ButtonToolbar>
                        </Link>
                    </div>
                </Card.Body>
            </Card>

        </div>
            );
        }
        export default PokeList;
